import { motion } from "framer-motion";
import { Link } from 'react-router-dom';
import { useEffect, useState } from "react";
import { FiMenu, FiArrowRight } from "react-icons/fi";
import { DonationButton } from "./NarBarComponents/DonationButton";
import ribbonlogo from '../../assets/images/ribbonlogo.jpg';
import facebookIcon from '../../assets/images/svgIcons/facebook.svg';
import instagramIcon from '../../assets/images/svgIcons/instagram.svg';
import twitterIcon from '../../assets/images/svgIcons/twitter.svg';
import '../NavBar/NavBar.css';

export const FlipNavWrapper = () => {
  return (
    <div className="bg-transparent">
      <FlipNav />
    </div>
  );
};

const FlipNav = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [isScrolled, setIsScrolled] = useState(false);
  const [isMouseNearTop, setIsMouseNearTop] = useState(false);

  const handleScroll = () => {
    if (window.scrollY > 50) {
      setIsScrolled(true);
    } else {
      setIsScrolled(false);
    }
  };

  const handleMouseMove = (e) => {
    setIsMouseNearTop(e.clientY < 100);
  }

  useEffect(() => {
    window.addEventListener("scroll", handleScroll);
    window.addEventListener("mousemove", handleMouseMove);
    return () => {
      window.removeEventListener("scroll", handleScroll);
      window.removeEventListener("mousemove", handleMouseMove);
    };
  }, []);

  return (
    <nav className={`navbar-fixed ${!isScrolled || isMouseNearTop ? 'visible' : 'hidden'}`}>
      <nav className={`flex justify-between items-center bg-transparent w-full max-w-screen-xl mx-auto md:py-8 ${isScrolled ? 'scrolled-nav' : ''}`}>
        <div className="flex-1 flex justify-start gap-20">
          <Link to="/" className="hidden">
            <img src={ribbonlogo} style={{ width: '100px', height: 'auto' }} alt="Ribbon Logo" />
          </Link>
          <NavLeft setIsOpen={setIsOpen} />
          <NavMenu isOpen={isOpen} />
        </div>      
        {/*<div className="flex flex-col items-center">
          <NavLeft setIsOpen={setIsOpen} />
          <NavMenu isOpen={isOpen} />
        </div>*/}
        <div className="flex-1 flex justify-end items-center gap-8">
          <NavLink text="Contact" />
          <DonationButton />
        </div>
      </nav>
    </nav>
  );
};

const NavLinks = () => {
  return (
    <>
      <NavLink text="About" />
      <NavLink text="Impact" />
      <NavLink text="Events" />
    </>
  )
}

const NavLeft = ({ setIsOpen }) => {
  return (
    <div className="flex flex-col lg:flex-row items-center justify-center gap-20">
      <motion.button
        whileHover={{ scale: 1.05 }}
        whileTap={{ scale: 0.95 }}
        className="block lg:hidden text-gray-950 text-2xl"
        onClick={() => setIsOpen((pv) => !pv)}
      >
        <FiMenu />
      </motion.button>
      <NavLinks />
    </div>
  );
};

const NavLink = ({ text }) => {
  return (
    <a
      href={text.toLowerCase()}
      rel="nofollow"
      className="hidden lg:block h-[30px] overflow-hidden font-extrabold"
    >
      <motion.div whileHover={{ y: -30 }}>
        <span className="flex items-center h-[30px] text-purple-500">{text}</span>
        <span className="flex items-center h-[30px] text-purple-600">
          {text}
        </span>
      </motion.div>
    </a>
  );
};

const NavMenu = ({ isOpen }) => {
  return (
    <motion.div
      variants={menuVariants}
      initial="closed"
      animate={isOpen ? "open" : "closed"}
      className="absolute p-4 bg-white shadow-lg left-0 right-0 top-[4rem] origin-top flex flex-col gap-4 z-50 max-h-[90vh] overflow-y-auto"
      >
      <NavLinks />
      <DonationButton />
    </motion.div>
  );
};

const MenuLink = ({ text }) => {
  return (
    <motion.a
      variants={menuLinkVariants}
      rel="nofollow"
      href="#"
      className="h-[30px] overflow-hidden font-medium text-lg flex items-start gap-2"
    >
      <motion.span variants={menuLinkArrowVariants}>
        <FiArrowRight className="h-[30px] text-gray-950" />
      </motion.span>
      <motion.div whileHover={{ y: -30 }}>
        <span className="flex items-center h-[30px] text-gray-500">{text}</span>
        <span className="flex items-center h-[30px] text-indigo-600">
          {text}
        </span>
      </motion.div>
    </motion.a>
  );
};

const menuVariants = {
  open: {
    scaleY: 1,
    transition: {
      when: "beforeChildren",
      staggerChildren: 0.1,
    },
  },
  closed: {
    scaleY: 0,
    transition: {
      when: "afterChildren",
      staggerChildren: 0.1,
    },
  },
};

const menuLinkVariants = {
  open: {
    y: 0,
    opacity: 1,
  },
  closed: {
    y: -10,
    opacity: 0,
  },
};

const menuLinkArrowVariants = {
  open: {
    x: 0,
  },
  closed: {
    x: -4,
  },
};
